[{"location":"list/","page":"-","title":"-","text":"","category":"page"},{"location":"list/#Master_Thesis_Paulogcd_2025.Bellman_FOC_1-Tuple{}","page":"-","title":"Master_Thesis_Paulogcd_2025.Bellman_FOC_1","text":"The Bellman_FOC_1 function is not to be used alone, but with the backwards function.\n\nfunction Bellman_FOC_1(;s_range::AbstractRange,\n            sprime_range::AbstractRange,\n            consumption_range::AbstractRange,\n            labor_range::AbstractRange,\n            value_function_nextperiod::Any,\n            β = 0.96::Float64, \n            z = 1::Float64,\n            ρ = 1.5::Float64,\n            φ = 2::Float64,\n            proba_survival = 0.9::Float64,\n            r = ((1-0.9)/0.9)::Float64,\n            w = 0.0::Float64,\n            h = 2.00::Float64,\n            return_full_grid = true::Bool, \n            return_budget_balance = true::Bool)::NamedTuple\n\n\n\n\n\n","category":"method"},{"location":"list/#Master_Thesis_Paulogcd_2025.Bellman_FOC_2-Tuple{}","page":"-","title":"Master_Thesis_Paulogcd_2025.Bellman_FOC_2","text":"The Bellman_FOC_2 function is not to be used alone, but with the backwards function.\n\nfunction Bellman_FOC_2(;s_range::AbstractRange,\n            sprime_range::AbstractRange,\n            consumption_range::AbstractRange,\n            labor_range::AbstractRange,\n            value_function_nextperiod::Any,\n            β = 0.96::Float64, \n            z = 1::Float64,\n            ρ = 1.5::Float64,\n            φ = 2::Float64,\n            proba_survival = 0.9::Float64,\n            r = ((1-0.9)/0.9)::Float64,\n            w = 0.0::Float64,\n            h = 2.00::Float64,\n            return_full_grid = true::Bool, \n            return_budget_balance = true::Bool)::NamedTuple\n\n\n\n\n\n","category":"method"},{"location":"list/#Master_Thesis_Paulogcd_2025.Bellman_numerical-Tuple{}","page":"-","title":"Master_Thesis_Paulogcd_2025.Bellman_numerical","text":"The Bellman_numerical function is not to be used alone, but with the backwards function.\n\n\tfunction Bellman_numerical(;s_range::AbstractRange,\n\t\t\t\tsprime_range::AbstractRange,\n\t\t\t\tconsumption_range::AbstractRange,\n\t\t\t\tlabor_range::AbstractRange,\n\t\t\t\tvalue_function_nextperiod::Any,\n\t\t\t\tβ = 0.96::Float64, \n\t\t\t\tz = 1::Float64,\n\t\t\t\tρ = 1.5::Float64,\n\t\t\t\tφ = 2::Float64,\n\t\t\t\tproba_survival = 0.9::Float64,\n\t\t\t\tr = ((1-0.9)/0.9)::Float64,\n\t\t\t\tw = 0.0::Float64,\n\t\t\t\th = 2.00::Float64,\n\t\t\t\treturn_full_grid = true::Bool, \n\t\t\t\treturn_budget_balance = true::Bool)::NamedTuple\n\n\n\n\n\n","category":"method"},{"location":"list/#Master_Thesis_Paulogcd_2025.HP-Tuple{}","page":"-","title":"Master_Thesis_Paulogcd_2025.HP","text":"The HP function is not to be used alone.  It returns the estimated Health Proxy value for a combination of age and temperature values. \n\n\n\n\n\n","category":"method"},{"location":"list/#Master_Thesis_Paulogcd_2025.Health_Proxy_plot-Tuple{}","page":"-","title":"Master_Thesis_Paulogcd_2025.Health_Proxy_plot","text":"The Health_Proxy_plot function plots the predicted health proxy  for a range of age, and for the different temperature scenarios.\n\n\n\n\n\n","category":"method"},{"location":"list/#Master_Thesis_Paulogcd_2025.average_health_plot-Tuple{}","page":"-","title":"Master_Thesis_Paulogcd_2025.average_health_plot","text":"The average_health_plot function generates a plot of the average health over time for the three different temperature scenarios.  It takes N and T as arguments, with N the size of the population, and T the number of periods.\n\n\n\n\n\n","category":"method"},{"location":"list/#Master_Thesis_Paulogcd_2025.backwards_FOC_1-Tuple{}","page":"-","title":"Master_Thesis_Paulogcd_2025.backwards_FOC_1","text":"function backwards_FOC_1(;s_range::AbstractRange,\n        sprime_range::AbstractRange,\n        consumption_range::AbstractRange,\n        labor_range::AbstractRange,\n        nperiods::Integer,\n        z = ones(nperiods)::Array,\n        β = 0.9::Float64,\n        r = final_r::Array,\n        ρ = 1.50::Float64, \n        φ = 2.00::Float64,\n        proba_survival = 0.90::Float64,\n        w = 0.00::Float64,\n        h = \"good\"::AbstractString, \n        return_full_grid = false::Bool, \n        return_budget_balance = true::Bool)::NamedTuple\n\n\n\n\n\n","category":"method"},{"location":"list/#Master_Thesis_Paulogcd_2025.backwards_FOC_2-Tuple{}","page":"-","title":"Master_Thesis_Paulogcd_2025.backwards_FOC_2","text":"function backwardsFOC2(;srange::AbstractRange,         sprimerange::AbstractRange,         consumptionrange::AbstractRange,         laborrange::AbstractRange,         nperiods::Integer,         z = ones(nperiods)::Array,         β = 0.9::Float64,         r = finalr::Array,         ρ = 1.50::Float64,          φ = 2.00::Float64,         probasurvival = 0.90::Float64,         w = 0.00::Float64,         h = \"good\"::AbstractString,          returnfullgrid = false::Bool,          returnbudgetbalance = true::Bool)::NamedTuple\n\n\n\n\n\n","category":"method"},{"location":"list/#Master_Thesis_Paulogcd_2025.backwards_numerical-Tuple{}","page":"-","title":"Master_Thesis_Paulogcd_2025.backwards_numerical","text":"function backwards(;s_range::AbstractRange,\n\t\tsprime_range::AbstractRange,\n\t\tconsumption_range::AbstractRange,\n\t\tlabor_range::AbstractRange,\n\t\tnperiods::Integer,\n\t\tz = ones(nperiods)::Array,\n\t\tβ = 0.9::Float64,\n\t\tr = final_r::Array,\n\t\tρ = 1.50::Float64, \n\t\tφ = 2.00::Float64,\n\t\tproba_survival = 0.90::Float64,\n\t\tw = 0.00::Float64,\n\t\th = \"good\"::AbstractString, \n\t\treturn_full_grid = false::Bool, \n\t\treturn_budget_balance = true::Bool)::NamedTuple\n\n\n\n\n\n","category":"method"},{"location":"list/#Master_Thesis_Paulogcd_2025.budget_surplus-Tuple{}","page":"-","title":"Master_Thesis_Paulogcd_2025.budget_surplus","text":"The budget_surplus function computes the budget states for certain levels of consumption, labor supply, productivity, and savings.\n\nIts syntax is:\n\nbudget_surplus(;c::Float64,\n\tl::Float64,\n\tsprime::Float64,\n\ts::Float64,\n\tz::Float64,\n\tr::Float64)::Float64\n\n\n\n\n\n","category":"method"},{"location":"list/#Master_Thesis_Paulogcd_2025.delete-Tuple{}","page":"-","title":"Master_Thesis_Paulogcd_2025.delete","text":"The delete function deletes the generated plots and results. It checks if the \"output\" folder exists, and delete it if it is the case.\n\n\n\n\n\n","category":"method"},{"location":"list/#Master_Thesis_Paulogcd_2025.health-Tuple{}","page":"-","title":"Master_Thesis_Paulogcd_2025.health","text":"The health function is not to be used alone.  It returns the estimated health transition probabilities for a combination of age, temperature, and previous health state values.\n\n\n\n\n\n","category":"method"},{"location":"list/#Master_Thesis_Paulogcd_2025.health_transition_3D_plot-Tuple{}","page":"-","title":"Master_Thesis_Paulogcd_2025.health_transition_3D_plot","text":"The health_transition_3D_plot function generates 3D plots of the health transition  probabilities. It produces 5 html files, which correspond to transition probabilities  from the 5 possible health states.\n\n\n\n\n\n","category":"method"},{"location":"list/#Master_Thesis_Paulogcd_2025.plot_demographic_comparison-Tuple{}","page":"-","title":"Master_Thesis_Paulogcd_2025.plot_demographic_comparison","text":"This function plots the demographic evolution of the four different scenarios.\n\n\n\n\n\n","category":"method"},{"location":"list/#Master_Thesis_Paulogcd_2025.plot_policies_FOC_1-Tuple{}","page":"-","title":"Master_Thesis_Paulogcd_2025.plot_policies_FOC_1","text":"The plot_policies_FOC_1 function generates the plot  of the policies with an average per age category.\n\n\n\n\n\n","category":"method"},{"location":"list/#Master_Thesis_Paulogcd_2025.plot_pure_numerical-Tuple{}","page":"-","title":"Master_Thesis_Paulogcd_2025.plot_pure_numerical","text":"The plot_consumption_pure_numerical function generates the plot  of the policies with an average per age category.\n\n\n\n\n\n","category":"method"},{"location":"list/#Master_Thesis_Paulogcd_2025.population_health_simulation-Tuple{}","page":"-","title":"Master_Thesis_Paulogcd_2025.population_health_simulation","text":"The population_health_simulation function is not to be used alone. It produces a population simulation in which individuals do not draw their living status,  but draw their health status each period.\n\n\n\n\n\n","category":"method"},{"location":"list/#Master_Thesis_Paulogcd_2025.produce_graph-Tuple{Any}","page":"-","title":"Master_Thesis_Paulogcd_2025.produce_graph","text":"This function is not to be used alone.  The produce_graph function generates a plot of demographic evolution with three different populations with three different  temperature paths. \n\n\n\n\n\n","category":"method"},{"location":"list/#Master_Thesis_Paulogcd_2025.run-Tuple{}","page":"-","title":"Master_Thesis_Paulogcd_2025.run","text":"The run function generates all plots of the package, in an \"output\" folder.\n\n\n\n\n\n","category":"method"},{"location":"list/#Master_Thesis_Paulogcd_2025.survival-Tuple{}","page":"-","title":"Master_Thesis_Paulogcd_2025.survival","text":"This function is not to be used alone. The survival function computes the probability of survival for a combination of age and temperature.\n\n\n\n\n\n","category":"method"},{"location":"list/#Master_Thesis_Paulogcd_2025.temperature-Tuple{}","page":"-","title":"Master_Thesis_Paulogcd_2025.temperature","text":"The temperature function returns the plot of average annual  temperature from 1900 to 2022.\n\n\n\n\n\n","category":"method"},{"location":"list/#Master_Thesis_Paulogcd_2025.test-Tuple{}","page":"-","title":"Master_Thesis_Paulogcd_2025.test","text":"The test function ensures the package is well loaded.\n\n\n\n\n\n","category":"method"},{"location":"list/#Master_Thesis_Paulogcd_2025.utility-Tuple{}","page":"-","title":"Master_Thesis_Paulogcd_2025.utility","text":"The utility function is defined such that its syntax is:\n\nutility(;c,l,z,w,h,ρ=1.5,φ=2)\n\nIt returns:\n\n(abs(c)^(1-ρ))/(1-ρ) - ξ(w,h) *((abs(l)^(1+φ)/(1+φ)))\n\n\n\n\n\n","category":"method"},{"location":"list/#Master_Thesis_Paulogcd_2025.ξ-Tuple{}","page":"-","title":"Master_Thesis_Paulogcd_2025.ξ","text":"The ξ function returns the disutility of work in the utility function.\n\nIts syntax is: \n\nξ(w,h)\n\nFor now, it returns 1.\n\n# (1+abs(w))*(1+1(h==\"bad\"))\n\n\n\n\n\n","category":"method"},{"location":"#Master_Thesis_Paulogcd_2025","page":"Home","title":"Master_Thesis_Paulogcd_2025","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for Master_Thesis_Paulogcd_2025.","category":"page"},{"location":"","page":"Home","title":"Home","text":"Welcome to this webpage, dedicated to the replication package of my Master Thesis. ","category":"page"},{"location":"#Installation","page":"Home","title":"Installation","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"using Pkg\nPkg.activate(\".\")\nPkg.add(url = \"https://github.com/Paulogcd/Master_Thesis_Paulogcd_2025.jl\")\nusing Master_Thesis_Paulogcd_2025\nMaster_Thesis_Paulogcd_2025.test() # verifying that the package is loaded","category":"page"}]
